import React from 'react'
import axios from 'axios'
import { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { doLoadSubscriptions } from '../redux/SubscriptionsActions';

const url = 'http://localhost:8000/subscriptions';

const SubscriptionComp = ({id}) => {
    const dispatch = useDispatch()
    const [subscriptions, setSubscriptions] = useState([])

    useEffect(() => {
      const fetchSubscriptions = async () => {
        const { data: subscriptionsData } = await axios.get(url);
        setSubscriptions(subscriptionsData);

        dispatch(doLoadSubscriptions(subscriptions));
      }
      fetchSubscriptions();
    }, [])
    // const subscription = useSelector(state => state.SubscriptionReducer.subscriptions);
    const users = useSelector(state => state.SubscriptionsReducer.subscriptions);
    console.log(users[0].date)
  return (
    <div>

    </div>
  )
}

export default SubscriptionComp
